@import "variables";
@import "home";
@import "reset";
* {
  box-sizing: border-box;
}

body,
body {
  font-size: 18px;
  height: 100%;
  background: $color1;
  font-family: "Barlow Condensed";
}
.menu-icon {
  position: fixed;
  right: 36px;
  top: 36px;
  padding: 20px;
  z-index: 11;

  .fas {
    font-size: 2rem;
    color: $color1;
  }
}
.primary-btn {
  background: $color1;
  color: white;
  -webkit-border-radius: 20px;
  -moz-border-radius: 20px;
  border-radius: 20px;
  text-align: center;
  padding: 15px 30px;
  text-transform: uppercase;
  display: inline-block;
  letter-spacing: 4px;
  width: 200px;
  margin-right: 15px;
  text-decoration: none;
  transition: all 0.5s ease-in-out;
  &:hover {
    background: $hoverColor;
  }
}
.ghost-btn {
  -webkit-border-radius: 20px;
  -moz-border-radius: 20px;
  border-radius: 20px;
  border: 4px solid $color1;
  text-align: center;
  padding: 11px 26px;
  text-transform: uppercase;
  display: inline-block;
  letter-spacing: 4px;
  width: 200px;
  text-decoration: none;
  color: $color2;
  transition: all 0.5s ease-in-out;
  &:hover {
    border-color: $hoverColor;
  }
}

.menu-active {
  .menu-icon {
    .fas {
      color: white;
    }
  }
  #menu {
    background-color: $color1;
    position: fixed;
    top: 0;
    bottom: 0;
    transform: translate3d(0, 0, 0);
    z-index: 10;
    display: flex;
    align-items: center;
    justify-content: center;
    opacity: 1;
    transition: all 1s ease-in-out;
    nav {
      width: 400px;
      text-align: center;
      a {
        font-size: 2.3rem;
        padding: 1rem;
        display: block;
        text-decoration: none;
        color: white;
        &:hover {
          color: $hoverColor;
        }
      }
    }
  }
}
#menu {
  background-color: $color1;
  position: fixed;
  width: 100%;
  top: 0;
  bottom: 0;
  transform: translate3d(-100%, 0, 0);
  z-index: 10;
  display: flex;
  align-items: center;
  justify-content: center;
  opacity: 1;
  transition: all 0.5s ease-in-out;
  nav {
    width: 400px;
    text-align: center;
    a {
      font-size: 2.3rem;
      padding: 1rem;
      display: block;
      text-decoration: none;
      color: white;
      &:hover {
        color: $hoverColor;
      }
    }
  }
}
